import React from 'react';

const ActiveItems = ({ items }) => (
  <div className="active-items">
    <h2>Active Items</h2>
    {items.map((item, index) => (
      <div key={index} className="active-item">
        {item.name} (+{item.hopsPerJumpBoost} HpJ)
      </div>
    ))}
  </div>
);

export default ActiveItems;
